import{_ as t,c as d,o as r,a4 as e}from"./chunks/framework.Br2U662V.js";const u=JSON.parse('{"title":"MiniGameConfig.asset 配置文件说明","description":"","frontmatter":{},"headers":[],"relativePath":"Design/AssetDescription.md","filePath":"Design/AssetDescription.md"}'),o={name:"Design/AssetDescription.md"},a=e('<h1 id="minigameconfig-asset-配置文件说明" tabindex="-1">MiniGameConfig.asset 配置文件说明 <a class="header-anchor" href="#minigameconfig-asset-配置文件说明" aria-label="Permalink to &quot;MiniGameConfig.asset 配置文件说明&quot;">​</a></h1><p>位于 <code>Assets/WX-WASM-SDK-V2/Editor/MiniGameConfig.asset</code> 即为 WXSDK 的导出配置文件，其中部分配置可在微信小游戏导出面板中可视化配置，本节将对配置文件中各项字段进行说明，开发者可直接修改其配置内容。</p><h2 id="projectconfig" tabindex="-1">ProjectConfig: <a class="header-anchor" href="#projectconfig" aria-label="Permalink to &quot;ProjectConfig:&quot;">​</a></h2><table><thead><tr><th>字段</th><th>类型</th><th>说明</th></tr></thead><tbody><tr><td>projectName</td><td>string</td><td>项目名称。</td></tr><tr><td>Appid</td><td>string</td><td>微信小游戏Appid，前往 <a href="https://mp.weixin.qq.com/" target="_blank" rel="noreferrer">https://mp.weixin.qq.com/</a> 注册获得。</td></tr><tr><td>CDN</td><td>string</td><td>游戏CDN前缀。</td></tr><tr><td>assetLoadType</td><td>int</td><td>首资源包加载方式，0: CDN加载；1: 小游戏包内加载。</td></tr><tr><td>compressDataPackage</td><td>bool</td><td>将首包资源Brotli压缩, 降低资源大小. 注意: 首次启动耗时可能会增加200ms, 仅推荐使用小游戏分包加载时节省包体大小使用。</td></tr><tr><td>VideoUrl</td><td>string</td><td>加载阶段视频URL，可缺省。</td></tr><tr><td>DST</td><td>string</td><td>导出路径。</td></tr><tr><td>StreamCDN</td><td>string</td><td>已废弃。</td></tr><tr><td>bundleHashLength</td><td>int</td><td>自定义Bundle文件名中hash部分长度，默认值32，用于缓存控制。</td></tr><tr><td>bundlePathIdentifier</td><td>string</td><td>路径中包含特定标识符开始下载bundle，将被自动缓存。半角分号分隔。</td></tr><tr><td>bundleExcludeExtensions</td><td>string</td><td>排除路径下指定类型文件不缓存。半角分号分隔。</td></tr><tr><td>AssetsUrl</td><td>string</td><td>已废弃。</td></tr><tr><td>MemorySize: 256</td><td>int</td><td>游戏内存大小(MB)。</td></tr><tr><td>HideAfterCallMain</td><td>bool</td><td>callmain完成后是否立即隐藏加载封面。</td></tr><tr><td>preloadFiles</td><td>string</td><td>预下载列表。半角分号分隔。</td></tr><tr><td>Orientation</td><td>int</td><td>设备方向，0:Portrait; 1:Landscape; 2:LandscapeLeft; 3:LandscapeRight。</td></tr><tr><td>bgImageSrc</td><td>string</td><td>启动背景图。</td></tr><tr><td>dataFileSubPrefix</td><td>string</td><td>拼接在DATA_CDN和首包资源文件名的路径，用于首包资源没放到DATA_CDN根目录的情况。</td></tr><tr><td>maxStorage</td><td>int</td><td>最大缓存容量，单位MB，设置后若接近容量阈值将自动回收。</td></tr><tr><td>defaultReleaseSize</td><td>int</td><td>清理缓存时默认额外清理的大小，单位Bytes，默认值30MB。</td></tr><tr><td>texturesHashLength</td><td>int</td><td>微信压缩纹理工具处理的尾部hash长度，用于识别缓存。</td></tr><tr><td>texturesPath</td><td>string</td><td>微信压缩纹理工具处理的纹理CDN拼接路径。</td></tr><tr><td>needCacheTextures</td><td>bool</td><td>是否缓存微信压缩纹理工具处理的贴图资源。</td></tr><tr><td>loadingBarWidth</td><td>int</td><td>加载进度条的宽度，默认240。</td></tr><tr><td>needCheckUpdate</td><td>bool</td><td>是否需要启动时自动检查小游戏是否有新版本。</td></tr><tr><td>disableHighPerformanceFallback</td><td>bool</td><td>是否禁止开启高性能模式后在不支持的iOS设备上回退为普通模式，注意：不要随意修改，只有开通高性能模式后并确认不回退才修改。</td></tr><tr><td>IOSDevicePixelRatio</td><td>float</td><td>IOS限制固定的分辨率，以减少内存，但是会降低游戏画面品质。</td></tr></tbody></table><h2 id="sdkoptions" tabindex="-1">SDKOptions: <a class="header-anchor" href="#sdkoptions" aria-label="Permalink to &quot;SDKOptions:&quot;">​</a></h2><table><thead><tr><th>字段</th><th>类型</th><th>说明</th></tr></thead><tbody><tr><td>UseFriendRelation</td><td>bool</td><td>是否使用好友关系链。</td></tr><tr><td>UseCompressedTexture</td><td>bool</td><td>已废弃。</td></tr><tr><td>UseMiniGameChat</td><td>bool</td><td>是否使用社交组件。</td></tr><tr><td>PreloadWXFont</td><td>bool</td><td>是否使用预载系统字体。</td></tr></tbody></table><h2 id="compileoptions" tabindex="-1">CompileOptions: <a class="header-anchor" href="#compileoptions" aria-label="Permalink to &quot;CompileOptions:&quot;">​</a></h2><table><thead><tr><th>字段</th><th>类型</th><th>说明</th></tr></thead><tbody><tr><td>DevelopBuild</td><td>bool</td><td>Development Build.</td></tr><tr><td>AutoProfile</td><td>bool</td><td>Autoconnect Profiler.</td></tr><tr><td>ScriptOnly</td><td>bool</td><td>Scripts Only Build.</td></tr><tr><td>Il2CppOptimizeSize</td><td>bool</td><td>对应于Il2CppCodeGeneration选项，勾选时使用OptimizeSize(默认推荐)，生成代码小15%左右，取消勾选则使用OptimizeSpeed。游戏中大量泛型集合的高频访问建议OptimizeSpeed，在使用HybridCLR等第三方组件时只能用OptimizeSpeed。(Dotnet Runtime模式下该选项无效)。</td></tr><tr><td>profilingFuncs</td><td>bool</td><td>Profiling Funcs.</td></tr><tr><td>Webgl2</td><td>bool</td><td>WebGL2.0</td></tr><tr><td>fbslim</td><td>bool</td><td>导出时自动清理UnityEditor默认打包但游戏项目从未使用的资源，瘦身首包资源体积。（团结引擎已无需开启该能力）。</td></tr><tr><td>DeleteStreamingAssets</td><td>bool</td><td>Clear Streaming Assets.</td></tr><tr><td>ProfilingMemory</td><td>bool</td><td>Profiling Memory.</td></tr><tr><td>CleanBuild</td><td>bool</td><td>Clean WebGL Build.</td></tr><tr><td>CustomNodePath</td><td>string</td><td>已废弃。</td></tr><tr><td>showMonitorSuggestModal</td><td>bool</td><td>是否显示最佳实践检测弹框。</td></tr><tr><td>enableProfileStats</td><td>bool</td><td>是否显示性能面板。</td></tr><tr><td>enableRenderAnalysis</td><td>bool</td><td>是否显示渲染分析日志（develop build才生效）。</td></tr><tr><td>iOSAutoGCInterval</td><td>int</td><td>iOS高性能模式自动GC间隔(毫秒)。</td></tr><tr><td>enableIOSPerformancePlus</td><td>bool</td><td>是否使用iOS高性能Plus。</td></tr><tr><td>brotliMT: 1</td><td>bool</td><td>是否使用brotli多线程压缩</td></tr><tr><td>autoAdaptScreen</td><td>bool</td><td>是否使用自适应屏幕尺寸变化</td></tr></tbody></table><h2 id="compresstexture" tabindex="-1">CompressTexture: <a class="header-anchor" href="#compresstexture" aria-label="Permalink to &quot;CompressTexture:&quot;">​</a></h2><p>以下是微信压缩纹理工具涉及配置，如未使用微信压缩纹理工具可以不予设置。</p><table><thead><tr><th>字段</th><th>类型</th><th>说明</th></tr></thead><tbody><tr><td>halfSize</td><td>bool</td><td>已废弃。</td></tr><tr><td>useDXT5</td><td>bool</td><td>是否开启 PC 压缩纹理。</td></tr><tr><td>bundleSuffix</td><td>string</td><td>已废弃。</td></tr><tr><td>parallelWithBundle</td><td>int</td><td>已废弃。</td></tr><tr><td>bundleDir</td><td>string</td><td>自定义 AB 包目录路径。</td></tr><tr><td>dstMinDir</td><td>string</td><td>压缩纹理产物输出目录。</td></tr><tr><td>debugMode</td><td>bool</td><td>是否开启仅 ASTC 模式。</td></tr><tr><td>force</td><td>bool</td><td>是否强制重新执行。</td></tr></tbody></table><h2 id="playerprefskeys" tabindex="-1">PlayerPrefsKeys: <a class="header-anchor" href="#playerprefskeys" aria-label="Permalink to &quot;PlayerPrefsKeys:&quot;">​</a></h2><p>使用PlayerPref接口时传入的key，此处设置将预先加载。</p><h2 id="fontoptions" tabindex="-1">FontOptions: <a class="header-anchor" href="#fontoptions" aria-label="Permalink to &quot;FontOptions:&quot;">​</a></h2><p>字体相关配置。请阅读 <a href="./WXFont.html">WXFont章节</a>。</p><table><thead><tr><th>字段</th><th>类型</th><th>说明</th></tr></thead><tbody><tr><td>CJK_Unified_Ideographs</td><td>bool</td><td>-</td></tr><tr><td>C0_Controls_and_Basic_Latin</td><td>bool</td><td>-</td></tr><tr><td>CJK_Symbols_and_Punctuation</td><td>bool</td><td>-</td></tr><tr><td>General_Punctuation</td><td>bool</td><td>-</td></tr><tr><td>Enclosed_CJK_Letters_and_Months</td><td>bool</td><td>-</td></tr><tr><td>Vertical_Forms</td><td>bool</td><td>-</td></tr><tr><td>CJK_Compatibility_Forms</td><td>bool</td><td>-</td></tr><tr><td>Miscellaneous_Symbols</td><td>bool</td><td>-</td></tr><tr><td>CJK_Compatibility</td><td>bool</td><td>-</td></tr><tr><td>Halfwidth_and_Fullwidth_Forms</td><td>bool</td><td>-</td></tr><tr><td>Dingbats</td><td>bool</td><td>-</td></tr><tr><td>Letterlike_Symbols</td><td>bool</td><td>-</td></tr><tr><td>Enclosed_Alphanumerics</td><td>bool</td><td>-</td></tr><tr><td>Number_Forms</td><td>bool</td><td>-</td></tr><tr><td>Currency_Symbols</td><td>bool</td><td>-</td></tr><tr><td>Arrows</td><td>bool</td><td>-</td></tr><tr><td>Geometric_Shapes</td><td>bool</td><td>-</td></tr><tr><td>Mathematical_Operators</td><td>bool</td><td>-</td></tr><tr><td>CustomUnicode</td><td>bool</td><td>-</td></tr></tbody></table>',16),i=[a];function l(n,s,b,h,p,c){return r(),d("div",null,i)}const _=t(o,[["render",l]]);export{u as __pageData,_ as default};
